import React from "react";
import { AppBar, Toolbar, Typography, Button, Box, Container, Grid } from "@mui/material";
import { useNavigate } from "react-router-dom"; // Yönlendirme için gerekli

// Marka logoları
const brandLogos = [
  { name: "HONDA", src: "/logos/honda.png" },
  { name: "JAGUAR", src: "/logos/jaguar.png" },
  { name: "NISSAN", src: "/logos/nissan.png" },
  { name: "VOLVO", src: "/logos/volvo.png" },
  { name: "AUDI", src: "/logos/audi.png" },
];

const HomePage = () => {
  const navigate = useNavigate(); // sayfa yönlendirme

  return (
    <>
      {/* Navbar */}
      <AppBar position="static" elevation={0} style={{ backgroundColor: "white", color: "black" }}>
        <Toolbar sx={{ justifyContent: "space-between" }}>
          <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
            <span style={{ color: "#800000", fontWeight: "bold" }}>Sahibinden</span>
          </Typography>
          <Box sx={{ display: "flex", gap: 3, alignItems: "center" }}>
            <Button color="inherit" onClick={() => navigate("/login")}>Sign in</Button>
            <Button variant="contained" sx={{ backgroundColor: "#5c2e2e" }} onClick={() => navigate("/signup")}>Sign up</Button>
          </Box>
        </Toolbar>
      </AppBar>

      {/* Hero Section */}
      <Container maxWidth="xl" sx={{ mt: 8, mb: 6 }}>
        <Grid container spacing={4} alignItems="center">
          {/* Sol yazı ve buton */}
          <Grid item xs={12} md={6}>
            <Typography variant="h3" fontWeight="bold" gutterBottom>
              🔍 Find, compare and choose the best car for you
            </Typography>
            <Typography variant="h4" color="text.secondary" sx={{ mb: 4 }}>
              Easily and confidently
            </Typography>
            <Button
              variant="contained"
              sx={{
                backgroundColor: "#5c2e2e",
                paddingX: 4,
                paddingY: 1.5,
                fontSize: "1.1rem",
              }}
              onClick={() => navigate("/carlistpage")}
            >
              Compare Now
            </Button>
          </Grid>

          {/* Sağ araba görselleri */}
          <Grid item xs={12} md={6}>
            <Box sx={{ display: "flex", flexDirection: "column", gap: 4, alignItems: "center" }}>
              <img
                src="/logos/v107_20.png"
                alt="Lamborghini"
                style={{ width: "100%", maxWidth: 500, objectFit: "contain" }}
              />
              <img
                src="/logos/v105_475.png"
                alt="Audi"
                style={{ width: "100%", maxWidth: 500, objectFit: "contain" }}
              />
            </Box>
          </Grid>
        </Grid>
      </Container>

      {/* Marka Logoları */}
      <Box
        sx={{
          display: "flex",
          justifyContent: "space-around",
          alignItems: "center",
          flexWrap: "wrap",
          gap: 3,
          px: 6,
          pb: 6,
        }}
      >
        {brandLogos.map((brand) => (
          <img
            key={brand.name}
            src={brand.src}
            alt={brand.name}
            style={{
              height: 40,
              objectFit: "contain",
              marginInline: 8,
            }}
          />
        ))}
      </Box>
    </>
  );
};

export default HomePage;
